  \"hawaiian-islands-gravity-data-per-2-min-cell-96\",\n\t\"isopen\": false,\n\t\"url\":
  null,\n\t\"notes\": \"This 2' gravity density grid for the Principal Hawaiian Islands
  displays the distribution of about 61,000 terrestrial and marine gravity data held
  in the National Geodetic Survey gravity data base in July 1996. These data were
  augmented by gravity data contributions from NGA (former National Imagery and Mapping
  Agency (former Defence Mapping Agency)) and by satellite altimeter-derived marine
  gravity anomalies computed by Sandwell and Smith (1996). The values show the number
  of gravity data contained in a given 2' cell. Additional information is available
  at http://www.ngs.noaa.gov/GEOID/geoid.html We are particularly grateful to NGA
  (former National Imagery and Mapping Agency) for their assistance and their data
  contributions.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
